import React, { useState } from 'react';
import { Search, RefreshCw } from 'lucide-react';
import PromptGrid from './components/PromptGrid';
import FontRecommendations from './components/FontRecommendations';
import LoadingSpinner from './components/LoadingSpinner';
import ScoreSummary from './components/ScoreSummary';
import { fetchFontRecommendationsStream } from './services/api';

function App() {
    const [selectedPrompt, setSelectedPrompt] = useState('');
    const [recommendations, setRecommendations] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [scores, setScores] = useState([]);
    const [progress, setProgress] = useState(0);

    const handlePromptClick = async (prompt) => {
        setSelectedPrompt(prompt);
        setLoading(true);
        setError('');
        setRecommendations([]);
        setScores([]);
        setProgress(0);

        try {
            const response = await fetchFontRecommendationsStream(
                prompt,
                "",
                (data) => {
                    // Handle progress updates
                    if (data.progress !== undefined) {
                        setProgress(data.progress);
                    }

                    // If we have partial results, show them
                    if (data.results?.recommendations) {
                        setRecommendations(data.results.recommendations.slice(0, 20));
                    }
                }
            );

            if (response.status === 'complete' && response.results?.recommendations) {
                // Take first 20 recommendations
                const topRecommendations = response.results.recommendations.slice(0, 20);
                setRecommendations(topRecommendations);
                setProgress(100);
            } else {
                setError('No recommendations found for this prompt.');
            }
        } catch (err) {
            setError('Failed to fetch recommendations. Please try again.');
            console.error('Error:', err);
        } finally {
            setLoading(false);
        }
    };

    const handleScoreSaved = (font, score) => {
        setScores(prev => [...prev, { font, score, timestamp: new Date() }]);
    };

    const handleRefresh = () => {
        if (selectedPrompt) {
            handlePromptClick(selectedPrompt);
        }
    };

    return (
        <div className="min-h-screen bg-gray-50">
            {/* Header */}
            <header className="bg-white shadow-sm border-b border-gray-200">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="flex justify-between items-center py-4">
                        <div className="flex items-center gap-3">
                            <Search className="text-primary-500" size={24} />
                            <h1 className="text-2xl font-bold text-gray-900">
                                Font Recommendation Evaluator
                            </h1>
                        </div>
                        {selectedPrompt && (
                            <button
                                onClick={handleRefresh}
                                disabled={loading}
                                className="flex items-center gap-2 px-4 py-2 bg-primary-500 text-white rounded-lg hover:bg-primary-600 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
                            >
                                <RefreshCw size={16} className={loading ? 'animate-spin' : ''} />
                                Refresh
                            </button>
                        )}
                    </div>
                </div>
            </header>

            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
                <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
                    {/* Left Column - Prompts Grid */}
                    <div className="lg:col-span-1">
                        <PromptGrid
                            onPromptClick={handlePromptClick}
                            selectedPrompt={selectedPrompt}
                        />
                    </div>

                    {/* Right Column - Recommendations and Scoring */}
                    <div className="lg:col-span-2 space-y-6">
                        {error && (
                            <div className="bg-red-50 border border-red-200 rounded-lg p-4">
                                <div className="text-red-800 text-sm">{error}</div>
                            </div>
                        )}

                        {loading && (
                            <div className="bg-white rounded-lg shadow-sm border border-gray-200">
                                <div className="p-6">
                                    <LoadingSpinner message={`Fetching font recommendations... ${progress}%`} />
                                    {progress > 0 && progress < 100 && (
                                        <div className="mt-4">
                                            <div className="w-full bg-gray-200 rounded-full h-2">
                                                <div
                                                    className="bg-primary-500 h-2 rounded-full transition-all duration-300"
                                                    style={{ width: `${progress}%` }}
                                                ></div>
                                            </div>
                                            <p className="text-sm text-gray-600 mt-2 text-center">
                                                Processing... {progress}% complete
                                            </p>
                                        </div>
                                    )}
                                </div>
                            </div>
                        )}

                        {!loading && !error && recommendations.length > 0 && (
                            <>
                                <FontRecommendations
                                    recommendations={recommendations}
                                    prompt={selectedPrompt}
                                    onScoreSaved={handleScoreSaved}
                                />

                                {scores.length > 0 && (
                                    <ScoreSummary scores={scores} />
                                )}
                            </>
                        )}

                        {!loading && !error && selectedPrompt && recommendations.length === 0 && (
                            <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-8 text-center">
                                <div className="text-gray-500">
                                    <Search size={48} className="mx-auto mb-4 text-gray-300" />
                                    <h3 className="text-lg font-medium text-gray-900 mb-2">
                                        No recommendations found
                                    </h3>
                                    <p className="text-gray-600">
                                        Try selecting a different prompt or refreshing the results.
                                    </p>
                                </div>
                            </div>
                        )}

                        {!selectedPrompt && (
                            <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-8 text-center">
                                <div className="text-gray-500">
                                    <Search size={48} className="mx-auto mb-4 text-gray-300" />
                                    <h3 className="text-lg font-medium text-gray-900 mb-2">
                                        Select a prompt to get started
                                    </h3>
                                    <p className="text-gray-600">
                                        Click on any prompt from the grid to fetch font recommendations and start scoring.
                                    </p>
                                </div>
                            </div>
                        )}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;
